/**
 * Fits a 2-phase Markovian Arrival Process (MMPP2) to match the given first three moments and a fourth parameter G2.
 *
 *
 * This method calculates the rates (mu00, mu11) and transition rates (q01, q10) for a 2-phase MMPP
 * based on the given moments (E1, E2, E3) and the G2 parameter, which could represent a correlation or variability metric.
 *
 * @param E1 the first moment (mean)
 * @param E2 the second moment
 * @param E3 the third moment
 * @param G2 an additional parameter, often related to the index of dispersion or other characteristic
 * @return a MatrixCell containing the transition matrices for the MMPP2
 */

fun mmpp2_fit(E1: Double, E2: Double, E3: Double, G2: Double): MatrixCell {
    val SCV = (E2 - E1 * E2) / E1 / E1
    val mu00: Double
    val mu11: Double
    val q01: Double
    val q10: Double
    if (G2 < 1e-6) {
        mu00 = 2 * (6 * FastMath.pow(E1, 3) * SCV - E3) / E1 / (6 * FastMath.pow(E1, 3) * SCV + 3 * FastMath.pow(E1,
            3) * SCV * SCV + 3 * FastMath.pow(E1, 3) - 2 * E3)
        mu11 = 0.0
        q01 = 9 * FastMath.pow(E1, 5) * (SCV - 1) * (SCV * SCV - 2 * SCV + 1) / (6 * FastMath.pow(E1,
            3) * SCV - E3) / (6 * FastMath.pow(E1, 3) * SCV + 3 * FastMath.pow(E1, 3) * SCV * SCV + 3 * FastMath.pow(E1,
            3) - 2 * E3)
        q10 = -3 * (SCV - 1) * FastMath.pow(E1, 2) / (6 * FastMath.pow(E1, 3) * SCV - E3)
    } else {
        mu00 = mmpp2_fit_mu00(E1, E2, E3, G2)
        mu11 = mmpp2_fit_mu11(E1, E2, E3, G2)
        q01 = mmpp2_fit_q01(E1, E2, E3, G2)
        q10 = mmpp2_fit_q10(E1, E2, E3, G2)
    }

    val d0 = Matrix(arrayOf(doubleArrayOf(-mu00 - q01, q01), doubleArrayOf(q10, -mu11 - q10)))
    val d1 = Matrix(arrayOf(doubleArrayOf(mu00, 0.0), doubleArrayOf(0.0, mu11)))
    val map = MatrixCell()
    map[0] = d0
    map[1] = d1
    return map
}
